    false,nt"url": null,nt"notes": "This annual narrative report for Upper
    Mississippi River National Wildlife and Fish Refuge summarizes activities for Winona
    District, La Crosse District, McGregor District, and Savanna District during 1992.
    The report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition is also covered.  The report includes a planning section which
    discusses the management plan, public participation, compliance with environmental
    and cultural resource mandates, research, and investigations.  Refuge administration
    is outlined; information about personnel, youth programs, manpower programs, volunteer
    programs, funding, safety, and technical assistance is given.  Habitat management
    is also covered.  Subjects include wetlands, forests, croplands, grasslands, grazing,
    haying, fire management, pest control, water rights, wilderness and special areas,
    Farmersu2019 Home Administration Conservation Easements, and private lands.  The
    wildlife section of the report discusses wildlife diversity, endangered species,
    threatened species, waterfowl, marsh birds, water birds, shorebirds, raptors, game
    mammals, fisheries resources, animal control, marking/banding, and disease control.
     The public uses of the Refuge described in this report include outdoor classrooms,
    interpretive exhibits, hunting, fishing, trapping, wildlife observation, camping,
    picnicking, off-road vehicling, law enforcement, and concessions.  The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, major maintenance, equipment utilization/replacement, communications
    systems, computer systems, and energy conservation.  Cooperative programs and items
    of interest are provided at the end; brochures are attached.",nt"license_title":
